using System;

public static class PhysicalConstants
{
    public const double UniversalGasConstant = 8.314;
}

public struct CombustionSolverParamsByDoubles
{
    public double A; // Pre-exponential factor
    public double E; // Activation energy
    public double N; // Reaction order
}

public struct KineticFlameParamsByDoubles
{
    public double ThermalConductivity;
    public double FinalTemperature;
    public double AverageMolarMass;
}

public struct KineticFlameCombustionParamsByDoubles
{
    public double AverageKineticFlameTemperature;
    public double AverageKineticFlameDensity;
    public double KineticFlameHeight;
}

public class CombustionSolver
{
    // Method to extract kinetic burn parameters
    private void ExtractKineticBurnParams(CombustionSolverParamsByDoubles solverParams, out double aKineticFlame, out double eKineticFlame, out double nu)
    {
        aKineticFlame = solverParams.A;
        eKineticFlame = solverParams.E;
        nu = solverParams.N;
    }

    // Method to extract kinetic burn parameters
    private void ExtractKineticBurnParams(KineticFlameParamsByDoubles kineticFlameParams, out double aKineticFlame, out double eKineticFlame, out double nu)
    {
        aKineticFlame = kineticFlameParams.FinalTemperature;
        eKineticFlame = kineticFlameParams.AverageMolarMass;
        nu = 0; // Default value
    }

    // Method to calculate the heat flux from the kinetic flame to the propellant surface
    public double GetKineticFlameHeatFlux(double pressure, double surfaceTemperature, double decomposeRate, CombustionSolverParamsByDoubles solverParams, KineticFlameParamsByDoubles kineticFlameParams, ref KineticFlameCombustionParamsByDoubles contextBag)
    {
        double thermalConductivity = kineticFlameParams.ThermalConductivity;
        double kineticFlameTemperature = kineticFlameParams.FinalTemperature;

        contextBag.AverageKineticFlameTemperature = GetAverageKineticFlameTemperature(surfaceTemperature, kineticFlameParams);
        contextBag.AverageKineticFlameDensity = GetAverageKineticFlameDensity(pressure, contextBag.AverageKineticFlameTemperature, kineticFlameParams);
        contextBag.KineticFlameHeight = GetKineticFlameHeight(decomposeRate, contextBag.AverageKineticFlameTemperature, contextBag.AverageKineticFlameDensity, solverParams);

        double heatFlux = thermalConductivity * (kineticFlameTemperature - surfaceTemperature) / contextBag.KineticFlameHeight;

        return heatFlux;
    }

    // Method to calculate the average kinetic flame temperature
    private double GetAverageKineticFlameTemperature(double surfaceTemperature, KineticFlameParamsByDoubles kineticFlameParams)
    {
        double kineticFlameTemperature = kineticFlameParams.FinalTemperature;
        return (kineticFlameTemperature + surfaceTemperature) / 2.0;
    }

    // Method to calculate the average kinetic flame density
    private double GetAverageKineticFlameDensity(double pressure, double averageKineticFlameTemperature, KineticFlameParamsByDoubles kineticFlameParams)
    {
        double averageMolarMass = kineticFlameParams.AverageMolarMass;
        return pressure * averageMolarMass / (PhysicalConstants.UniversalGasConstant * averageKineticFlameTemperature);
    }

    // Method to calculate the kinetic flame height
    private double GetKineticFlameHeight(double decomposeRate, double averageKineticFlameTemperature, double averageKineticFlameDensity, CombustionSolverParamsByDoubles solverParams)
    {
        ExtractKineticBurnParams(solverParams, out double aKineticFlame, out double eKineticFlame, out double nu);

        double molarEnergy = PhysicalConstants.UniversalGasConstant * averageKineticFlameTemperature;
        double poweredDensity = Math.Pow(averageKineticFlameDensity, nu);
        double volumedMassFlow = aKineticFlame * poweredDensity;

        double flameHeight = decomposeRate / (volumedMassFlow * Math.Exp(-eKineticFlame / molarEnergy));

        return flameHeight;
    }
}

public class Example
{
    public static void Main(string[] args)
    {
        // Example usage
        var solver = new CombustionSolver();

        // Define parameters
        var solverParams = new CombustionSolverParamsByDoubles { A = 1.0, E = 10.0, N = 2.0 };
        var kineticFlameParams = new KineticFlameParamsByDoubles { ThermalConductivity = 0.1, FinalTemperature = 1000.0, AverageMolarMass = 30.0 };
        var contextBag = new KineticFlameCombustionParamsByDoubles();

        // Calculate heat flux
        double heatFlux = solver.GetKineticFlameHeatFlux(101325.0, 300.0, 0.1, solverParams, kineticFlameParams, ref contextBag);

        Console.WriteLine("Heat Flux: " + heatFlux);
    }
}
